import AddTodo from "./components/AddTodo";
import Header from "./components/Header";
import Button from "./components/Button";
import TodoList from "./components/TodoList";

function App() {
  return (
    <div className="App">
      <Header title="To Do List" />
      <div className="container">
        <AddTodo />
        <Button text="Dodaj" />
      </div>
      <TodoList />
    </div>
  );
}

export default App;
